import React from 'react'

const AnimationKeyFrame = () => {
  return (
    <div className='py-12'>
          <h3 className='font-inter font-semibold text-4xl text-black text-center pb-9'>KeyFrame Practice </h3>
          <div>
              <p className='w-24 h-24 bg-yellow-700 rounded-full'></p>
         </div>
    </div>
  )
}

export default AnimationKeyFrame
